import React, { useState } from "react";
import { Link } from 'react-router-dom';
import '../css/logprov.css'; 

const LogCom = ({ goToFinal }) => {
  const [tel, setOtroTel] = useState('');
  const [document, setCuitDoc] = useState('');
  const [Text, setPresent] = useState('');
  const [linkweb, setWeb] = useState('');
  const [linkInst, setIg] = useState('');
  const [linkFace, setFace] = useState('');
  const [aceptado, setAceptado] = useState(false);
  const [categorias, setCategorias] = useState([]);
 

  const handleSeleccion = (opcionSeleccionada) => {
    setCategorias((prevCategorias) =>
      prevCategorias.includes(opcionSeleccionada)
        ? prevCategorias.filter((categoria) => categoria !== opcionSeleccionada)
        : [...prevCategorias, opcionSeleccionada]
    );
  };


  const handleOtroTelChange = (event) => {
    setOtroTel(event.target.value);
  };

  const handleCuitOrDocChange = (event) => {
    setCuitDoc(event.target.value);
  };

  const handlePresentChange = (event) => {
    setPresent(event.target.value);
  };

  const handleWebChange = (event) => {
    setWeb(event.target.value);
  };

  const handleIgChange = (event) => {
    setIg(event.target.value);
  };

  const handleFaceChange = (event) => {
    setFace(event.target.value);
  };


  const handleCheckboxChange = (e) => {
    setAceptado(e.target.checked);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (aceptado) {
      try {
        const formData = {
          tel,
          document,
          presentacion: Text,
          linkWeb: linkweb,
          linkInstagram: linkInst,
          linkFacebook: linkFace,
          categorias,
          
        };

        const response = await fetch('http://localhost:3000/registro/comerciante', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify(formData)
        });
        const data = await response.json();
        console.log(data);
        
        navigate(`/final/${userId}`);
      } catch (error) {
        console.error('Error:', error);
      }
    } else {
      // Mostrar mensaje de que debe aceptar los términos y condiciones
      alert("Debes aceptar los términos y condiciones");
    }
  };

  return (
    <div className="RestForm">
      <form onSubmit={handleSubmit}>
        <label htmlFor="otrotel">Otro Teléfono</label>
        <input
          type="tel"
          id="otrotel"
          value={tel}
          onChange={handleOtroTelChange}
          required
        />
        <label htmlFor="cuitordoc">Cuit o Documento</label>
        <input
          type="text"
          id="cuitordoc"
          value={document}
          onChange={handleCuitOrDocChange}
          required
        />
        <label htmlFor="present">Presentación</label>
        <input
          type="text"
          id="present"
          value={Text}
          onChange={handlePresentChange}
          required
        />
        <label htmlFor="linkweb">Sitio web</label>
        <input
          type="url"
          id="linkweb"
          value={linkweb}
          onChange={handleWebChange}
          required
        />
        <label htmlFor="linkInst">Instagram</label>
        <input
          type="url"
          id="linkInst"
          value={linkInst}
          onChange={handleIgChange}
          required
        />
        <label htmlFor="linkFace">Facebook</label>
        <input
          type="url"
          id="linkFace"
          value={linkFace}
          onChange={handleFaceChange}
          required
        />
      </form>

      <div className="Select">
        <h2>¿Qué productos y servicios ofrece?</h2>
        <div className="SelectProd">
          {['Venta al público', 'Servicio a domicilio', 'Golosinas', 'Cigarrillos', 'Bebidas', 'Galletiteria', 'Helados y Hielo', 'Productos congelados', 'Lacteos', 'Fiambres', 'Productos de limpieza', 'Productos de higiene'].map(categoria => (
            <button
              key={categoria}
              type="button"
              className={categorias.includes(categoria) ? 'selected' : ''}
              onClick={() => handleSeleccion(categoria)}
            >
              {categoria}
            </button>
          ))}
        </div>
      </div>

      <div className="FinAndTerm">
        <form className="Terms">
          <input type="checkbox" id="terminos" onChange={handleCheckboxChange} />
          <label htmlFor="terminos">Acepto los términos y condiciones</label>
        </form>
        <button type="submit" disabled={!aceptado} className='Fin'><Link to="/final">Finalizar</Link></button>
      </div>

      <div className='volver'><button type="button"><Link to="/login">Volver</Link></button></div>
    </div>
  );
};

export default LogCom;
